import React, { useEffect, useState } from 'react';


const Main = () => {

  const [member1List, setMember1List] = useState([])
  const [member2List, setMember2List] = useState([])

  useEffect(() => {
    fetch('http://localhost:8080/member1')
      .then(response => response.json())
      .then(response => {
        console.log(response)
        setMember1List(response)
      })
      .catch(error => console.error('Error fetching data:', error));
  }, []);

  useEffect(() => {
    fetch('http://localhost:8080/member2')
      .then(response => response.json())
      .then(response => {
        console.log(response)
        setMember2List(response)
      })
      .catch(error => console.error('Error fetching data:', error));
  }, []);

  const memberPrint = (arr) => {

    const result = []

    for (let i = 0; i < arr.length; i++) {

      result.push(
        <div>
          {arr[i].mb_name}
          {arr[i].mb_address}
          {arr[i].mb_tel}
        </div>
      )

    }
    return (
      <>
        {result}
      </>
    );
  }

  const kakaoMap = () => {

    return(
      <>

      <html>
        <head>
          <meta charset="utf-8"/>
          <title>Kakao 지도 시작하기</title>
        </head>
        <body>
          <div id="map" style="width:500px;height:400px;"></div>
          <script type="text/javascript" src="//dapi.kakao.com/v2/maps/sdk.js?appkey=	e2ffa5d281a35c8ed81d03237d02357b"></script>
          
        </body>
      </html>


      </>
    );


  }

  return (
    <>
    {kakaoMap}
    </>
  )


}


export default Main;
